It was wonderful as always to have a long-time advocate of Tri-County, Michael Carroll of Dean Bank come in to present the ever important personal finance lesson to Grade 12 students. They heard all about credit scores, bank loans, interest rates, credit card mistakes and misconceptions, and so many more topics that we all wish we were taught in high school! Thank you Mr. Carroll!

#personalfinance #tricounty #workhardtodaycounts #seniors #adulting
@deanbankma @ Tri-County Regional Vocational Technical High School

